import React from "react";
import "./ScrollText.css";

function ScrollText() {
    return (
        <div className="absolute inset-0 -rotate-12 pointer-events-none opacity-[0.05] select-none flex flex-col justify-between overflow-hidden z-0">
  <div className="relative whitespace-nowrap overflow-hidden py-2">
    <div className="scroll-line scroll-delay-0">
      Creative Developer • Digital Artist • Interactive Designer • Creative Developer • Digital Artist • Interactive Designer •
    </div>
  </div>
  <div className="relative whitespace-nowrap overflow-hidden py-2">
    <div className="scroll-line scroll-delay-1">
      WebGL • Three.js • React • TypeScript • WebGL • Three.js • React • TypeScript •
    </div>
  </div>
  <div className="relative whitespace-nowrap overflow-hidden py-2">
    <div className="scroll-line scroll-delay-2">
      Motion Design • 3D Animation • UI/UX • Motion Design • 3D Animation • UI/UX •
    </div>
  </div>
</div>
    );
}   

export default ScrollText;
